        <i className='material-icons' {...other}>
            {children}
            <style jsx>
                {`
                    i{
                        font-size: ${size}em;
                        line-height: inherit;
                        vertical-align: middle;
                    }
                `}
            </style>
        </i>
    )
}
//Propstypes
Icon.propTypes = {
    size: PropTypes.number,
}
